(2801, 'frFR', 'Au cœur des ténèbres', 'Frayez-vous un chemin jusqu\’au cœur de la manaforge Oméga et affrontez l\’incarnation des ténèbres, Dimensius l\’Omni-dévoreur.', 65727),
(2800, 'frFR', 'Les monstres des sables', 'Perturbez les tentatives du tisseforge Araz d\’invoquer Dimensius et réfugiez-vous au sein des sables mortels dans l\’ombre de la manaforge Oméga.', 65727),
(2799, 'frFR', 'La puissance de l\’Ombre-Garde', 'Accédez au cœur de la manaforge Oméga et perturbez les manœuvres de l\’Ombre-Garde.', 65727),
