(2712, 'frFR', 'La trame viride', 'Nymue tisse les motifs hypnotiques du Rêve d\’émeraude. Notre intrusion a perturbé la trame et nous en subirons les conséquences.', 65727),
(2711, 'frFR', 'Incursion en fusion', 'Larodar, corrompu par la flamme, cherche à plonger le Rêve d\’émeraude dans le feu. S\’il devait y parvenir, tout serait réduit en cendres.', 65727),
(2710, 'frFR', 'Sillage de l\’Incarnation', 'Fumeron s\’est introduit dans le Rêve d\’émeraude. Si personne ne les arrête, ses troupes brûleront tout sur leur passage.', 65727),
(2709, 'frFR', 'Au bord du Vide', 'Sarkareth se dresse au bord de l\’abîme, désireux de maîtriser la puissance de Neltharion et de revendiquer l\’héritage de l\’ancien Gardeterre.', 65727),
(2708, 'frFR', 'L\’ombre de Neltharion', 'Quelque chose, avide de nouvelles victimes, s\’agite au cœur des ténèbres qui ont autrefois corrompu le Gardeterre.', 65727),
(2707, 'frFR', 'Fureur des Géants', 'Un bataillon de Zaqalis a lancé un assaut dévastateur sur le creuset afin de détruire tout ce qui leur barre la route.', 65727),
(2706, 'frFR', 'La fureur de l\’orage', 'La fureur de Raszageth menace de détruire la prison des autres incarnations. Si elle arrive à ses fins, les Incarnations sèmeront le chaos partout sur Azeroth.', 65727),
(2705, 'frFR', 'Les cavernes de l\’Imprégnation', 'Kurog Totem-Sinistre s\’apprête à libérer de monstrueux élémentaires afin d\’annihiler toute personne osant s\’opposer à lui.', 65727),
(2704, 'frFR', 'Les rebuts', 'Oubliées pendant des millénaires, les créations de Neltharion se sont transformées en quelque chose de monstrueux.', 65727),
(2703, 'frFR', 'Rempart primordial', 'Le Conseil primordial renforce ses défenses au cœur de la montagne. Ses rangs doivent être brisés pour empêcher la libération des Incarnations.', 65727),
