(2347, 'frFR', 'Emprise de la domination', 'Les plus terribles fidèles de Zovaal ont déjà détruit des millions de civilisations. Vont-ils réussir à annihiler le cosmos ?', 65727),
(2346, 'frFR', 'Plaines Éphémères', 'L\’essence de la création se fait dévorer lentement mais sûrement. Si personne n\’intervient, c\’est la réalité entière qui finira par s\’effondrer.', 65727),
(2345, 'frFR', 'Assise de la Création', 'Lihuvim mène un combat perdu d\’avance contre la domination. À moins qu\’on ne vole à son secours, son pouvoir tombera aux mains du Geôlier.', 65727),
(2344, 'frFR', 'Le châtiment', 'Sylvanas Coursevent attend au sommet de la tour. C\’est là que va se jouer l\’ultime confrontation qui décidera du sort du cosmos.', 65727),
(2343, 'frFR', 'Les entraves du destin', 'La rivière des âmes achève sa course au sommet de la tour. Anéantissez ceux qui s\’en nourrissent afin de libérer les innombrables esprits privés de leur dernier repos.', 65727),
(2342, 'frFR', 'La bastille Noire', 'Les hurlements des tourmentés alimentent l\’armée du Geôlier. Abrégez leurs souffrances et privez l\’Antre de sa plus précieuse ressource.', 65727),
(2341, 'frFR', 'L\’avant-garde du Geôlier', 'L\’avant-garde du Geôlier se tient prête à repousser toute attaque. Il faut percer les lignes ennemies pour pénétrer dans le sanctum du Geôlier.', 65727),
(2340, 'frFR', 'Audience avec l\’arrogance', 'À l\’abri dans sa tour, Denathrius attend avec impatience l\’ultime confrontation qui scellera le sort de Revendreth.', 65727),
(2339, 'frFR', 'Le sang de la pierre', 'À l\’affût, les généraux de la Légion de pierre de Denathrius préparent un piège qui écrasera définitivement la rébellion.', 65727),
(2338, 'frFR', 'Reliquaire de l\’opulence', 'Alors que les aristocrates célèbrent leur victoire, les héros et héroïnes doivent débarquer dans leur réception et démanteler leur base de pouvoir.', 65727),
(2337, 'frFR', 'Caveaux drainants', 'L\’anima s\’écoule des caveaux du château Nathria comme d\’une plaie béante. Il faut stopper l\’hémorragie avant que Revendreth ne soit complètement exsangue.', 65727),
