INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2743, 'frFR', 'Céleste tempête-d\’or', '|cFFFFD200Boutique en jeu|r', 'Drapé de tonnerre, choisi par le destin. Des éclairs dorés enveloppent ses sabots, perçant le ciel comme s\’ils déchiraient la nuit. Les légendes le rattachent étroitement à l\’empereur Shaohao.', 65727),
(2742, 'frFR', 'Céleste sabot-tonnerre', '|cFFFFD200Boutique en jeu|r', 'Après sa chute, les derniers éclats de foudre du roi-tonnerre ont fusionné avec l\’esprit d\’un Dragon blanc. Dans sa foulée accompagnée d\’éclairs azur, il laisse derrière lui des nuages tourbillonnants. Là où régnait autrefois la tyrannie subsiste une lumière protectrice.', 65727),
(2798, 'frFR', 'Tombaile de bronze', '|cFFFFD200Haut fait :|r Maîtrise des voies temporelles turbulentes IV|n|cFFFFD200Catégorie :|r Marcheurs du temps|n', 'Bien que l\’on préfère généralement l\’esthétique sombre et mystérieuse en Revendreth, certains individus trouvent le lustre resplendissant plus à leur goût.', 65727),
(2797, 'frFR', 'Mouche nécrophage de bronze', '|cFFFFD200Haut fait :|r Maîtrise des voies temporelles turbulentes IV|n|cFFFFD200Catégorie :|r Marcheurs du temps', 'Il ne faut pas ménager ses efforts pour décorer une mouche nécrophage, mais certaines personnes disent que le jeu en vaut la chandelle.', 65727),
(2796, 'frFR', 'Aquilon de bronze', '|cFFFFD200Haut fait :|r Maîtrise des voies temporelles turbulentes IV|n|cFFFFD200Catégorie :|r Marcheurs du temps|n|n', 'Les fidèles destriers du Bastion sont choisis spécialement pour refléter la fierté et la noblesse des guerriers et guerrières des Transcendés.', 65727),
(2795, 'frFR', 'Lycodrac de bronze', '|cFFFFD200Haut fait :|r Maîtrise des voies temporelles turbulentes IV|n|cFFFFD200Catégorie :|r Marcheurs du temps|n|n', 'Les lycodracs majestueux se tortillent dans les cieux, libres comme la magie illimitée qui leur permet de voler.', 65727),
(1729, 'frFR', 'Gliss, le roi de la glisse', '|cFFFFD200Quête :|r EscarGO !|n|cFFFFD200Région : |rgrotte de Zaralek', 'Un grand escargot, un grand cœur, de grands rêves : c\’est tout Gliss.', 65727);
